css:
atom-text-editor .github-ConflictBlock {
  display: flex;
  align-items: center;
  margin-right: 10px;
  padding: 5px;
  cursor: default;
  color: rgba(189, 189, 189, 0.75);
}
atom-text-editor .github-ConflictBlock .github-ResolutionControls {
  flex: 1;
}
atom-text-editor .github-ConflictBlock .github-ResolutionControls button {
  margin-right: 10px;
}
atom-text-editor .github-ConflictBlock .github-ResolutionControls span {
  cursor: pointer;
}
atom-text-editor .github-SideDescription {
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: .9em;
}
atom-text-editor .github-ResolutionControls .icon {
  line-height: 0;
}
atom-text-editor .github-ConflictTopBlock {
  margin-top: 10px;
  border-top-left-radius: 0px;
  border-top-right-radius: 0px;
}
atom-text-editor .github-ConflictBottomBlock {
  margin-bottom: 10px;
  border-bottom-left-radius: 0px;
  border-bottom-right-radius: 0px;
}
atom-text-editor .github-ConflictOurs {
  margin-right: 10px;
  background-color: rgba(153, 106, 181, 0.15);
}
atom-text-editor .github-ConflictOurs.cursor-line {
  background-color: rgba(153, 106, 181, 0.25) !important;
